import React from 'react';
import { StyleSheet, Text, View, ImageBackground } from 'react-native';

import { screenWidth } from '../../utils/common';
console.log('screenWidth', screenWidth);

import GreenBackground from '../../assets/images/green-background.jpg';

console.log('GreenBackground', GreenBackground);

export default function GetOTP() {
  return (
    <View style={styles.container}>
      <ImageBackground style={styles.image} source={{url: 'https://image.freepik.com/free-vector/shiny-abstract-bubbles-decorated-green-background-copyspace_1302-19158.jpg'}}>
      <Text>Open up App.js to start working on your app!</Text>
      </ImageBackground>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'green',
    alignItems: 'center',
    justifyContent: 'center',
    borderBottomLeftRadius: screenWidth/2,
    borderBottomRightRadius: screenWidth/2
  },
  image: {
    flex: 1,
    resizeMode: "cover",
    justifyContent: "center"
  },
});
